import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 6.2-2312 Rental for storage unpaid for three years.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-2312.md","filePath":"vacode/6.2-2312.md"}'),o={name:"vacode/6.2-2312.md"},n=t('<h1 id="§-6-2-2312-rental-for-storage-unpaid-for-three-years" tabindex="-1">§ 6.2-2312 Rental for storage unpaid for three years. <a class="header-anchor" href="#§-6-2-2312-rental-for-storage-unpaid-for-three-years" aria-label="Permalink to &quot;§ 6.2-2312 Rental for storage unpaid for three years.&quot;">​</a></h1><p>If a company has received for safekeeping from any person any package or box to be stored in its general vault, and the rental for such storage shall have remained unpaid for a period of three years, the company shall have the right to open such package or box and to have the contents thereof inventoried, upon compliance substantially with the procedure as to witnesses, notices, and certificates provided for the opening of any box in §§ <a href="http://law.lis.virginia.gov/vacode/6.2-2305/" target="_blank" rel="noreferrer">6.2-2305</a> through <a href="http://law.lis.virginia.gov/vacode/6.2-2308/" target="_blank" rel="noreferrer">6.2-2308</a>. If the rental or other charges for the safekeeping of such package or box and the charges incident to the opening of the same remain unpaid for a period of two years from the date of such opening, the contents thereof may be sold upon compliance substantially with the procedure provided for the sale of the contents of any box in § <a href="http://law.lis.virginia.gov/vacode/6.2-2310/" target="_blank" rel="noreferrer">6.2-2310</a>, and the proceeds of such sale shall be treated in the same manner provided for the treatment of the proceeds of sale of the contents of any box in § <a href="http://law.lis.virginia.gov/vacode/6.2-2311/" target="_blank" rel="noreferrer">6.2-2311</a>.</p><p>Code 1950, § 6-273; 1966, c. 584, § 6.1-342; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',3),i=[n];function s(h,c,f,l,d,p){return a(),r("div",null,i)}const u=e(o,[["render",s]]);export{_ as __pageData,u as default};
